import "./Slide1.css";
import "../../App.css";

export default function Slide1() {
  return (
    <div className="item item-1">
     
    <div class="text-container">
      <p class="small-text">ПРИВЕТ,</p>
      <h1 class="main-title">ЭТО НЕ КОММЕРЧЕСКОЕ ЗАДАНИЕ</h1>
    </div>


    <button class="cta-button">
      <span class="arrow">&#8594;</span>
      Что дальше?
    </button>

    <img src="src\assets\global\Shape 1.png"></img>
    </div>
  );
}
